import React, { useEffect, useState } from 'react'
import axios from 'axios'

const App = () => {
  const [bikes, setBikes] = useState([])

  useEffect(() => {
    const getData = async () => {
      const { data } = await axios.get('/api/bikes')
      setBikes(data)
    }
    getData()
  }, [])
  return (
    <>
      {bikes.map(iter => <h1 key={iter._id}>{iter.make}</h1>)}
    </>
  )
}

export default App
